        <tbody>
            {% for usuario in usuarios %}
                <tr>
                    <td>{{ usuario.nombre }}</td>
                    <td>{{ usuario.email }}</td>
                    <td>{{ usuario.rol }}</td>
                    <td>{{ usuario.telefono }}</td>
                </tr>
            {% else %}
                <tr>
                    <td colspan=\"4\">No hay usuarios registrados</td>
                </tr>
            {% endfor %}
        </tbody>
    </table>
